    "Crescent Lake/North Platte National Wildlife Refuge Complex: Annual narrative
    report: Calendar year 1996",nt"tracking_summary": {ntt"total": 2,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-07-27T22:57:17.998852",nt"name": "crescent-lake-north-platte-national-wildlife-refuge-complex-annual-narrative-report-calend-95303",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Crescent
    Lake and North Platte National Wildlife Refuge outlines Refuge accomplishments during
    the 1996 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses management planning and research and investigations. Refuge
    administration is outlined; information about personnel, volunteer programs, funding,
    and technical assistance is given. Habitat management is also covered; subjects
    include wetlands, forests, grasslands, grazing, haying, fire management, pest control,
    water rights, and wilderness and special areas. The wildlife section of the report
    discusses wildlife diversity, endangered and threatened species, waterfowl, marsh
    birds and waterbirds, shorebirds, raptors, other migratory birds, game mammals,
    other resident wildlife, fisheries resources, animal control, and disease prevention
    and control. The public uses of the Refuge described in this report include outdoor
    classrooms, interpretive programs, hunting, fishing, trapping, wildlife observation,
    off-road vehicling, and law enforcement. The equipment and facilities section of
    the report provides information about new construction, rehabilitation, major maintenance,
    equipment utilization and replacement, and communication systems. Cooperative programs
    are provided at the end.",nt"license_title": "License Not Specified",nt"extras":
